// jobs.js
const jobs = [
  {
    id: 1,
    title: 'Frontend Developer',
    company: 'Tech Solutions',
    location: 'Remote',
    description: 'We are looking for a skilled Frontend Developer with experience in React.js to join our team. Responsibilities include building user interfaces, collaborating with backend developers, and optimizing applications for speed and scalability.'
  },
  {
    id: 2,
    title: 'Backend Developer',
    company: 'Innovatech',
    location: 'New York, NY',
    description: 'Join our backend team to design and implement APIs, manage databases, and ensure high performance and responsiveness to requests from the frontend.'
  },
  {
    id: 3,
    title: 'UI/UX Designer',
    company: 'Creative Minds',
    location: 'San Francisco, CA',
    description: 'Seeking a creative UI/UX Designer to design software and platforms that meet people\'s needs. You will combine interfaces and workflows to enhance user experience.'
  },
  {
    id: 4,
    title: 'DevOps Specialist',
    company: 'InfraTech',
    location: 'Austin, TX',
    description: 'Automate deployment pipelines, manage cloud infrastructure, and monitor system health. Experience with AWS, Docker, and CI/CD tools is essential.'
  },
  {
    id: 5,
    title: 'Full Stack Developer',
    company: 'InnovateX',
    location: 'Boston, MA',
    description: 'Develop and maintain full stack applications using React, Node.js, and PostgreSQL. You will work on both frontend and backend features, ensuring smooth integration and performance.'
  }
];

export default jobs;
